import React from "react";
import { Link } from "react-router-dom";
import styles from "./home.module.css"; // Import your CSS module

import Navigation from "../NavBar";
import Footer from "../footer";

const ExpenseTrackerHome = () => {
  return (
    <>
      <Navigation />
      <div className={styles.home}> {/* Use styles.home */}
        <div className={styles["home-page"]}> {/* Use styles["home-page"] */}
          <header className={styles.hero}> {/* Use styles.hero */}
            <div className={styles["hero-content"]}> {/* Use styles["hero-content"] */}
              <h1>Welcome to Expense Tracker</h1>
              <p>
                Track your expenses, manage your budgets, and stay in control of your spending!
              </p>
              <Link to="/expenses" className={styles["explore-btn"]}> {/* Use styles["explore-btn"] */}
                View Expenses
              </Link>
            </div>
          </header>

          <section className={styles.intro}> {/* Use styles.intro */}
            <h2>Our Features</h2>
            <div className={styles.features}> {/* Use styles.features */}
              <div className={styles.feature}> {/* Use styles.feature */}
                <h3>Add Expenses</h3>
                <p>
                  Quickly record your daily expenses with an intuitive interface.
                </p>
              </div>
              <div className={styles.feature}> {/* Use styles.feature */}
                <h3>Budget Management</h3>
                <p>
                  Set budgets and receive alerts when spending nears or exceeds limits.
                </p>
              </div>
              <div className={styles.feature}> {/* Use styles.feature */}
                <h3>Expense Reports</h3>
                <p>
                  Visualize your spending patterns with detailed charts and reports.
                </p>
              </div>
            </div>
          </section>
        </div>

        <Footer />
      </div>
    </>
  );
};

export default ExpenseTrackerHome;
